        <ng-container *ngTemplateOutlet="questions; context: { $implicit: question }" />
      </ng-container>
    </if>
  `,
  standalone: true,
  changeDetection: ChangeDetectionStrategy.OnPush,
  imports: [
    IonicModule,
    ...importRxTemplate(),
    NgTemplateOutlet,
    IfComponent,
    MultiCheckboxSectionComponent,
    QuestionTemplateDirective
  ]
})
