    IfComponent,
    UploadComponent
  ]
})
export class FileUploadComponent {
  filename: string | null = null;
  dataUrl: string | null = null;

  upload(files: DataUrlFile[]) {
    if (files[0] != null) {
      this.filename = files[0].name;
      this.dataUrl = files[0].dataUrl;
    }
  }

  clear() {
    this.filename = null;
    this.dataUrl = null;
  }
}

