export function AngularComponent<T1 extends AnyFunction>(h1: T1): ReturnType<T1>
export function AngularComponent<T1 extends AnyFunction, T2 extends AnyFunction>(h1: T1, h2: T2): ReturnType<T1> & ReturnType<T2>
